records.addlTxt:
Defendant Mark E Bourbonais in court, in custody, with attorney Nicole M Masnica.   Barbara A. Michaels appeared for the State of Wisconsin. Defendant entered a plea of guilty to count 1. Court conducted plea colloquy and found defendant guilty of count 1. Count 2 dismissed by operation of law.

The Defendant was sentenced to the following:
IMPOSED SENTENCE of: 

_ 5 YEARS IMPRISONMENT - CREDIT - 173 days
  -  2  YEARS OF INITIAL CONFINEMENT
  -  3 YEARS OF EXTENDED SUPERVISION;

*D/L REVOCATION: #36 months.
*IGNITION INTERLOCK: #36 months.

CONDITIONS OF PROBATION:  
*Absolute Sobriety;  
*No Use or Possession of alcohol, controlled substances or drug paraphernalia
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions
*Follow through with any treatment and/or counseling recommended by Agent;
*Do not drive or operate a motor vehicle without a valid license.
* Defendant to provide DNA sample, if not yet provided,  immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.

BLOOD DRAW FEE:  $35.00 to be paid as a condition of extended supervision - to be forward to City of New Berlin Police Department);

FINE:  $3801.00 (includes $50.00 IID fee) to be paid as a condition of extended supervision;

DNA SURCHARGE:  $250.00 to be paid as a condition of extended supervision;

Defendant is not eligible for Challenge Incarceration Program.
Defendant is eligible for Substance Abuse Program.

Felony warnings, voting rights and firearms warnings given.
